Defendant Tynisha Maria Smith in court with attorney Victoria M McCandless.  Defendant Tynisha Maria Smith in custody.  Jay R Pucek appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  

AS TO COUNT 01:
The Court imposed 6 months at the House of Correction, with Huber for work and school; good time allowed; credit for 79 days time served.  Court STAYED said sentence and placed defendant on probation for two (2) years.

AS TO COUNT 02:
The Court imposed 3months at the House of Correction, with Huber for work and school; good time allowed; consecutive to Count 1.  Court STAYED said sentence and placed defendant on probation for two (2) years, concurrent to Count 1.

CONDITIONS OF PROBATION FOR COUNTS 1 AND 2:
 - No controlled substances other than those prescribed by a duly licensed physician for defendant's mental or physical needs, and for only as long as deemed medically reasonable and necessary;
 - No alcohol;
 - Urine screens;
 - AODA assessment; treatment, if needed;
 - No contact with the victim, William W.
 - No contact with co-defendant Lyronex T. Fleiming;
 - Anger management counseling;
 - Obtain GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Pay restitution of $38.00 to William W., joint and several with co-defendant in case 14CF459. 
 - Pay DNA surcharge in Count 1 and Count 2, plus all other applicable costs, disbursements.  Failure to pay restitution, surcharges and all other amounts in full would result in a  civil judgment entered against defendant which is non-dischargable in bankruptcy.

Should defendant complete all conditions set forth by this Court, complete all conditions set by the Department of Corrections, pay all financial obligations ordered and remain free and clear of the criminal justice system arising to the level of probable cause, the Court would consider her petition for expungment.

